function doAction() {
    var morph = this.getMorph();
    if (!morph) return;
    var serializer = this.getSerializer();
    if (this.get("SerializeAsExpressionPlugin").value) {
        module('users.cschuster.Serialization').load(true);
        serializer.addPlugin(new users.cschuster.SerializeAsExpressionPlugin());
    }
    if (this.get("ExprPlugin").value) {
        this.get("ExprPlugin").load(); // as long as it's not in webwerkstatt core
        serializer.addPlugin(new lively.persistence.ExprPlugin());
    }
    if (this.get("HierachicalIds").value) {
        module('users.cschuster.sync.client').load(true);
        HierachicalIds.beGlobal();
    } else if (Global.HierachicalIds) {
        HierachicalIds.beNotGlobal();
    }
    var start = new Date().getTime();
    var data = serializer.serialize(morph);
    var time = new Date().getTime() - start;
    this.get("Results").textString = morph.name + ": " + (2 * data.length) + " bytes"
                                   + " in " + time + " ms";
}

function getMorph() {
    var morphs = this.get("DropZone").submorphs;
    if (morphs.length < 1) return alert("No morph in the DropZone");
    if (morphs.length > 1) return alert("Need exactly 1 morph in DropZone");
    return morphs[0];
}

function getSerializer() {
    var serializer = ObjectGraphLinearizer.forNewLivelyCopy();
    var p = new GenericFilter();
    var zone = this.get("DropZone");
    p.addFilter(function(obj, prop, value) { return value === zone })
    serializer.addPlugins([p]);
    return serializer;
}

